import React from 'react'
import "./NavBar.css"


function NavBar() {
  return (
    <div>
   <img className='logo' src="https://www.google.com/imgres?q=netflix%20logo&imgurl=https%3A%2F%2Fimages.ctfassets.net%2Fy2ske730sjqp%2F1aONibCke6niZhgPxuiilC%2F2c401b05a07288746ddf3bd3943fbc76%2FBrandAssets_Logos_01-Wordmark.jpg%3Fw%3D940&imgrefurl=https%3A%2F%2Fbrand.netflix.com%2Fen%2Fassets%2Flogos%2F&docid=2DBw-t8C_ICKSM&tbnid=Qp0b35TYZtOqSM&vet=12ahUKEwiz-qChpI6JAxW7XGwGHbOiKl0QM3oECBYQAA..i&w=940&h=529&hcb=2&ved=2ahUKEwiz-qChpI6JAxW7XGwGHbOiKl0QM3oECBYQAA" alt=''></img>

    <img className='Avatar' src="https://www.google.com/imgres?q=netflix%20logo&imgurl=https%3A%2F%2Fi.pinimg.com%2F736x%2F1b%2F54%2Fef%2F1b54efef3720f6ac39647fc420d4a6f9.jpg&imgrefurl=https%3A%2F%2Fin.pinterest.com%2Fpin%2Fnetflix-logo-icon-png-transparent-with-clear-background-id-471555--672443788128071810%2F&docid=l34xSU2MeEWS_M&tbnid=E1R1HDbe_vavYM&vet=12ahUKEwiz-qChpI6JAxW7XGwGHbOiKl0QM3oECB0QAA..i&w=735&h=752&hcb=2&ved=2ahUKEwiz-qChpI6JAxW7XGwGHbOiKl0QM3oECB0QAA" alt=""/>
    </div>
  )
}

export default NavBar
